using System;\nusing System.IO;\nusing System.Security.Cryptography;\n\nclass Program\n{\n    static void Main(string[] args)\n    {\n        // Create a new instance of the RijndaelManaged algorithm\n        RijndaelManaged algorithm = new RijndaelManaged();\n\n        // Set the key and initialization vector\n        algorithm.Key = new byte[] { 0x01, 0x02, 0x03, 0x04, 0x05, 0x06, 0x07, 0x08, 0x09, 0x10, 0x11, 0x12, 0x13, 0x14, 0x15, 0x16 };\n        algorithm.IV = new byte[] { 0x01, 0x02, 0x03, 0x04, 0x05, 0x06, 0x07, 0x08, 0x09, 0x10, 0x11, 0x12, 0x13, 0x14, 0x15, 0x16 };\n\n        // Create a new encryptor\n        ICryptoTransform encryptor = algorithm.CreateEncryptor();\n\n        // Encrypt some data\n        byte[] data = new byte[] { 0x00, 0x01, 0x02, 0x03, 0x04, 0x05, 0x06, 0x07, 0x08, 0x09 };\n        byte[] encryptedData = encryptor.TransformFinalBlock(data, 0, data.Length);\n\n        // Print the encrypted data\n        Console.WriteLine(BitConverter.ToString(encryptedData));\n    }\n}